import React, {useState} from 'react'

const TodoList = ({todos}) => {

  return (
    <div>
      {todos.map((item, i) =>
      <div key={i}>
        <span></span>
        <p>{item.todo}</p>
        <span></span>
        </div>
        )}
    </div>
  )
}
export default TodoList
